import './App.css';

function Shop() {

  useEffect(()=>{
    fetchItems();
  },[])
  
  const fetchItems = async() =>{
    const data = await fetch('https://fakestoreapi.com/products/1');
    
    const items = await data.json()
    
    console.log(items)
  }

  return (
    <div>
        <h1>Shop page</h1>
    </div>
  );
}

export default Shop;
